import React from 'react';


function Card(props) {
    return (
        <>
                        <div class="card" style={{ width: '18rem' }}>
                            <img src={props.imgsrc} class="card-img-top" alt="makeupBlog" style={{width:'200px', height:'200px'}} />
                            <h3 class="card-title"><b>{props.title}</b></h3>
                            <hr />
                            <div class="card-body">
                                <p class="card-text">{props.para}</p>
                            </div>
                        </div>
        </>
    );
}
export default Card;
